import React, { Component } from 'react';

class Home extends Component {
  constructor(){
    super();
    this.state={
      name:"张三",
      age:"18",
      title:"我是title"
    }
  }
  render() {
    return (
      <div>
        <div>hello react</div>
        <div>name:{this.state.name}</div>
         <div title={this.state.title} >我是一个DIV</div>
      </div>
    );
  }
}

export default Home;
